import React from 'react';
import './AlertDialogBox.css';

const ErrorPopup = ({ message, onClose }) => {
  return (
    <div className="error-popup">
      <div className="error-content">
        <p>{message}</p>
        <button className="close-btn" onClick={onClose}>
          &times;
        </button>
      </div>
    </div>
  );
};

export default ErrorPopup;
